import styled from 'styled-components';
import './Home.css';

import React from 'react';
import logo from "./spotify.png";



const StyledImg = styled.img`
  width: 250px;

`;


function Home() {
  return (
    <div className='home'>
      <StyledImg src={logo} alt="Logo"></StyledImg>
      <p>Artists</p>
      <p>Albums</p>
      <p>Genres</p>
      <p>tracks</p>
      <p>Albums genres</p>

  </div>
  )

}

export default Home;
